description:
Some gifts never get old.

John (Brad Armstrong) is your everyday average guy. Unfortunately, it's his 45th birthday. He's starting to feel his age, and starting to find a few extra grey hairs. Can anyone say &quot;mid-life crisis&quot;.

So he starts doing all the things guys do in an attempt to regain their youth from sports cars, to hair dye, tanning salon, and hair salon, from hitting the gym, to hitting the clubs, and of course dating younger women. The fun begins as John tries to keep up with all the young hotties, as they put him through his paces. Featuring adult super-stars Kaylani Lei, Gracie Glam, Asa Akira, Misty Stone, Lala Star, Amia Miley, Alexa Nicole and Madison Ivy.

Most of whom are 20 years his junior, so he has his work cut out for him... Thank god for the little blue pill. Then one night when he's picking up his date, he's met at the door by her mother Maria (Francesca Le). She's not at all happy at the age difference, and lets him know it in no uncertain terms. She puts the kibosh on the date, but as John drives home he can't get her out of his head. He starts to forget about his bevy of young beauties. All he can think about is Maria. He finally gets up the nerve to go back, and after a little heart-to-heart, the sparks fly. And with Maria's help he realizes age is just a number, and that it's not about trying to act young... it's about finding someone who'll keep you young... or at least &quot;Young at Heart.&quot;

